Superhero Network Entertainment Group presents:

PARAGON 1B

&quot;Benjamin Byrne is a teenage boy who exists in an overly idyllic world. After years of depression over the loss of his Father, Ben attempts to commit suicide. He unknowingly falls through a doorway into our world. Lost and alone, Ben sleeps in a homeless shelter earning money ingesting experimental medicinces. When the side effects kick in, Ben's system restarts imbuing him with super powers and special abilities. With the assistance of Latisha, a volunteer at the shelter, Ben embarks on a journey to uncover why this world cannot become the unpoiled world that he is from.&quot;
